import Home from "./Home";
import {useMetaTitle} from "../hooks/MetaTitle"

const Blogs = () => {
  const [title, setTitle] = useMetaTitle("");
  setTitle (() => { "Blog Posts of Mohsinur Rahman" })
  
    return (
        <>
            <h1>{ title }</h1>
            <Home />
        </>
    );
};
  
export default Blogs;
